import logo from './logo.svg';
import './App.css';
import Bingo from  './Bingo.js';
import Home from './Home.js';
import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    

    // <h1>test</h1>
    
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />}>
        </Route>
      </Routes>
    </BrowserRouter>
   

  );
}

export default App;
